const userReducer =  (state = {}, action) => {
    switch (action.type) {
        case "user/login":
            console.log(action.payload)
            return{
                ...action.payload
            }           
        case "user/logout":
            return {}; 
        default:
            return state;
    }
}
export default userReducer;
